INSERT INTO `SessionChatLog` VALUES (132,1696,_binary '','2025-05-01 13:05:43','你好，我是咨询师996，请问你今天有什么想聊的吗？'),(133,1696,_binary '\0','2025-05-01 13:05:56','我最近总是感觉很焦虑，晚上也睡不好'),(134,1696,_binary '','2025-05-01 13:06:22','嗯，听起来你最近压力挺大的，能具体说说是什么让你感到焦虑吗？'),(135,1696,_binary '\0','2025-05-01 13:06:32','主要是工作上的事情，项目进度很紧，而且领导对我要求很高。'),(136,1696,_binary '','2025-05-01 13:06:42','我理解这种感受。面对高压的工作环境，我们也可以一起探讨一些缓解的方法。'),(137,1696,_binary '','2025-05-01 13:06:53','比如我们可以从呼吸放松训练开始，你觉得怎么样？'),(138,1696,_binary '\0','2025-05-01 13:07:01','好的，我愿意试试看。');
/*!40000 ALTER TABLE `SessionChatLog` ENABLE KEYS */;
UNLOCK TABLES;

